DROP TABLE IF EXISTS `renteditems`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `renteditems` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `item_id` int(11) NOT NULL,
  `contract_id` int(11) NOT NULL,
  `duration_id` int(11) NOT NULL,
  `gearstate_id` int(11) NOT NULL DEFAULT 1,
  `price` int(11) DEFAULT 0,
  `comment` varchar(255) DEFAULT NULL,
  `linenb` int(11) DEFAULT 0,
  `partialreturn` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `renteditem_category_idx` (`gearstate_id`),
  KEY `renteditem_contract_idx` (`contract_id`),
  KEY `renteditem_duration_idx` (`duration_id`),
  KEY `renteditem_item_idx` (`item_id`),
  CONSTRAINT `renteditem_category` FOREIGN KEY (`gearstate_id`) REFERENCES `gearstates` (`id`),
  CONSTRAINT `renteditem_contract` FOREIGN KEY (`contract_id`) REFERENCES `contracts` (`id`) ON DELETE CASCADE,
  CONSTRAINT `renteditem_duration` FOREIGN KEY (`duration_id`) REFERENCES `durations` (`id`),
  CONSTRAINT `renteditem_item` FOREIGN KEY (`item_id`) REFERENCES `items` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1857 DEFAULT CHARSET=utf8mb3;
